(function (global) {
    var sfx = {
            win: '',
            dice: '',
            move: '',
            six: ''
        },
        isAvailable = (function () {
            return !!(Audio && Audio.prototype.play);
        }());

    function play(name, callback) {
        var snd;

        if (sfx[name]) {
            snd = new Audio('data:audio/mp3;base64,' + sfx[name]);
            if (typeof callback === 'function') {
                snd.addEventListener('ended', callback);
            }
            snd.play();
        }
    }

    global.Sfx = {
        play: play,
        isAvailable: function () {
            return isAvailable;
        }
    };
}(this));